if (baujahr){
	def construction = baujahr.p.value()
	
	baujahr.p.each {bauj ->
		if (bauj < construction){
			construction = bauj
		}
	}

	construction = new java.text.SimpleDateFormat('yyyy', Locale.US).parse(construction.toString())
	
	return construction
}

if (baujahr){
	if (baujahr.p.values().size() > 1){
		def renovation = baujahr.p.value()
		
		baujahr.p.each {bauj ->
			if (bauj > renovation){
				renovation = bauj
			}
		}
		
		renovation = new java.text.SimpleDateFormat('yyyy', Locale.US).parse(renovation.toString())
		
		return renovation
	}
}
